    render() {
        let goal =this.props.goal.body;
        return (
            <div>
                <Paper style={styles.paper} square>
                    <Typography fontWeight="fontWeightBold" variant="h3" style={styles.DailyGoal}>Daily Goal</Typography>
                    <br></br>
                    <div style={styles.Star}>
                        <StarBorderOutlinedIcon></StarBorderOutlinedIcon><StarBorderOutlinedIcon></StarBorderOutlinedIcon><StarBorderOutlinedIcon></StarBorderOutlinedIcon>
                    </div>
                  
                    <br></br>
                    <Typography  fontWeight="fontWeightBold" variant="h2" style={styles.Goal} >{goal}</Typography>
                    <Button style={styles.NextButton}>
                        <NavigateNextIcon style={styles.NextButtonIcon}></NavigateNextIcon>
                    </Button>
                </Paper>
            </div>
        )
    }
}

